package HashMap;import java.util.Scanner;import java.util.TreeMap;public class ques4 {    public static void main(String[] args) {        Scanner sc = new Scanner(System.in);        System.out.println("Enter the size of arr :");        int n = sc.nextInt();        int []arr = new int[n];        System.out.println("Enter the value of element :");        for(int i = 0; i<n;i++)        {            arr[i] = sc.nextInt();        }        TreeMap<Integer, Integer> tm = new TreeMap<>();        for(int i = 0; i<n;i++)        {            tm.put(arr[i],1);        }        System.out.println(tm.lastEntry().getKey());    }}